IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[InsertContact]') AND type in (N'P', N'PC'))
BEGIN
EXEC dbo.sp_executesql @statement = N'CREATE PROCEDURE [dbo].[InsertContact]
@FirstName NVARCHAR(50),
@LastName NVARCHAR(50),
@Title NVARCHAR(50)
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

INSERT INTO [Contact]
           ([FirstName]
           ,[LastName]
           ,[Title]
           ,[AddDate]
           ,[ModifiedDate])
     VALUES
           (@FirstName,@LastName,@Title,GETDATE(),GETDATE());
           SELECT SCOPE_IDENTITY() AS NewContactID WHERE @@ROWCOUNT > 0;
           
END
' 
END
GO
