BEGIN
EXEC dbo.sp_executesql @statement = N'CREATE PROCEDURE [dbo].[ContactsbyState]

	@statecode nvarchar(50)

AS
SELECT DISTINCT Contact.* from [Contact],[Address] 
WHERE	 [Contact].[ContactID]=[Address].[ContactID] AND [Address].[StateProvince]=@statecode
' 
END
