/****** Object:  StoredProcedure [dbo].[AddressCountForContact]    Script Date: 01/21/2011 19:23:43 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[AddressCountForContact]') AND type in (N'P', N'PC'))
BEGIN
EXEC dbo.sp_executesql @statement = N'CREATE PROCEDURE [dbo].[AddressCountForContact]

	@contactID int
AS
	SELECT MAX(RTRIM(LastName) + '', '' + FirstName) as Name,COUNT(addressID) AS AddressCount
	FROM  Contact,Address
	WHERE Contact.ContactID=Address.ContactID 
	AND Contact.ContactID=@contactID
	GROUP BY Contact.ContactID
	RETURN
' 
END
GO
